*/
:root, .__fb-light-mode {
  --bg-color-background: #23232d;
  --bg-color-first: #2c2c36;
  --bg-color-second: #26262f;
  --bg-color-hover: #3b3b4b;

  --border-color: #2c2c36;

  --icon-change-partly: 81%;
  --icon-change-full: 100%;
    --surface-background: var(--bg-color-first);
    --disabled-button-background: var(--bg-color-first);
    --comment-background: var(--bg-color-second);
    --primary-button-background: var(--bg-color-second);
    --card-background: var(--bg-color-second);
    --secondary-button-background: var(--bg-color-hover);
    --wash: var(--bg-color-background);
    --fds-spectrum-slate-tint-50: var(--bg-color-second);

  --text-color-first: #dfdfdf;
  --fds-white-alpha-80: rgba(223, 223, 223, .8);
  --fds-white-alpha-40: rgba(223, 223, 223, .4);
  --text-color-second: #a7a7a7;
  --text-color-green: #42b72a;
  --text-color-blue: #8ba2d2;
  --text-color-red: #f13f3f;
    --primary-text: var(--text-color-first);
    --section-header-text: var(--text-color-first);
    --primary-button-text: var(--text-color-first);
    --accent: var(--text-color-first);
    --secondary-text: var(--text-color-second);
    --placeholder-text: var(--text-color-second);
    --disabled-text: var(--text-color-second);
    --divider: var(--text-color-second);

  --photo-blur:0px;
  --photo-brightness: 100%;
  --photo-contrast: 100%;
  --opacity-chat-head:1;
}


