:root {
    /* color variables - darkest to lightest */
    --jet: hsl(0, 0%, 12%);
    --space: hsl(0, 0%, 13%);
    --raven: hsl(0, 1%, 15%);
    --asher: hsl(0, 1%, 17%);
    --aztec: hsl(0, 1%, 20%);
    --cape-cod: hsl(0, 0%, 23%);
    --corduroy: hsl(0, 1%, 26%);
    --mine: hsl(0, 0%, 28%);
    --mystic: hsl(0, 0%, 38%);
    --grey: hsl(0, 0%, 67%);
    --alabaster: hsl(168, 15%, 83%);
    --zircon: hsl(0, 2%, 91%);
    --concrete: hsl(0, 0%, 95%);

    --limestone: hsl(168, 15%, 17%);
    --elm: hsl(169, 51%, 32%);
    --jade: hsl(165, 42%, 35%);
    --robin: hsl(166, 18%, 38%);
    --neptune: hsl(165, 34%, 60%);
    --conch: hsl(165, 13%, 65%);
    --green-shadow: hsl(165, 25%, 66%);
    --powder-ash: hsl(165, 13%, 75%);
    --mint-ice: hsl(165, 70%, 90%);

    /* backgrounds */
    --bkg-nav: var(--jet);
    --bkg-main: var(--space);
    --bkg-card: var(--raven);
    --bkg-card-foot: var(--asher);
    --bkg-nav-link-hover: var(--corduroy);
    --bkg-button: var(--jade);
    --bkg-button-hover: var(--elm);

    /* text */
    --txt-main: var(--concrete);
    --txt-second: var(--zircon);
    --txt-grey: var(--grey);
    --txt-nav-link: var(--alabaster);
    --txt-link: var(--neptune);
    --txt-link-bright: var(--mint-ice);
    --txt-button: white;

    /* borders */
    --border: var(--mine);
    --border-bright: var(--mystic);
  }

  /* Main Pages & Sections */
  body,
  .gr-homePageBody,
  .mainContent,
  .mainContentFloat,
  #rating_graph,
  .rating_graph,
  .mainContentContainer,
  .dropdown__menu--wantToReadMenu,
